int quadN(const int pReq, const quadShape shape)
{
  switch(shape)
  {
    case quadShape::pentatope:
      switch(pReq)
      {
        case 2:
          return 5;
        case 3:
          return 15;
        case 4:
          return 20;
        case 5:
          return 30;
        case 6:
          return 56;
        case 7:
          return 70;
        case 8:
          return 105;
        case 9:
          return 151;
        case 10:
          return 210;
        case 11:
          return 281;
        case 12:
          return 445;
        // case 13:
        //   return 585;
        // case 14:
        //   return 725;
        // case 15:
        //   return 930;
        // case 16:
        //   return 1160;
        default:
          throw std::runtime_error("quadrature rule for pentatope, pReq not found");
      }
      break; // should never get here
    case quadShape::prism:
      switch(pReq)
      {
        case 2:
          return 6;
        case 3:
          return 12;
        case 4:
          return 20;
        case 5:
          return 27;
        case 6:
          return 61;
        case 7:
          return 72;
        case 8:
          return 114;
        case 9:
          return 159;
        case 10:
          return 259;
        case 11:
          return 322;
        case 12:
          return 468;
        case 13:
          return 608;
        default:
          throw std::runtime_error("quadrature rule for prism, pReq not found");
      }
      break; // should never get here
    case quadShape::tesseract:
      switch(pReq)
      {
        case 3:
          return 16;
        case 5:
          return 24;
        case 7:
          return 57;
        case 9:
          return 160;
        case 11:
          return 272;
        case 13:
          return 512;
        case 15:
          return 728;
        case 17:
          return 1384;
        default:
          throw  std::runtime_error("quadrature rule for tesseract, pReq not found");
      }
      break;
    default:
      throw  std::runtime_error("quadrature rule for this type not found");
      break; // should never get here
  }
}

void Quadrature::coordinate(int n, quad &x, quad &y, quad &z, quad &t)
{
  assert(n >= 0);
  assert(n < Nquad_);
  x= x_[n];
  y= y_[n];
  z= z_[n];
  t= t_[n];
}

void Quadrature::weight(int n, quad &w)
{
  assert(n >= 0);
  assert(n < Nquad_);
  w= w_[n];
}

